      critere: quest,
      choice: e.value,
      na: false,
      chapitre: chapter,
      rubrique: rubriq
    }

    const indexObject = this.responses.findIndex((el: any) => {
      return el.id === data.id
    });

    if (indexObject === -1) {
      this.responses.push(data);
    } else {
      this.responses.splice(indexObject, 1);
      this.responses.push(data);
    }

    console.log(this.responses);
  }

